export default function NavDesktop({ colorBlack }) {
    function addItem_Active_Default() {
        for (
            var key = 0; key < document.getElementsByClassName("mv-nav-type-pc").length; key++
        ) {
            document
                .getElementsByClassName("mv-nav-type-pc")[key].classList.remove("mv-nav-item__active_default");
            document
                .getElementsByClassName("motor-name-layout")[key].classList.remove("motor-name-layout-active");
        }
        document
            .getElementsByClassName("mv-nav-type-pc")[0]
            .classList.add("mv-nav-item__active_default");
        document
            .getElementsByClassName("motor-name-layout")[0]
            .classList.add("motor-name-layout-active");
    }

    function changeItem_Active(i) {
        for (
            var key = 0; key < document.getElementsByClassName("mv-nav-type-pc").length; key++
        ) {
            document
                .getElementsByClassName("mv-nav-type-pc")[key].classList.remove("mv-nav-item__active_default");
            document
                .getElementsByClassName("motor-name-layout")[key].classList.remove("motor-name-layout-active");
        }
        document
            .getElementsByClassName("mv-nav-type-pc")[i].classList.add("mv-nav-item__active_default");
        document
            .getElementsByClassName("motor-name-layout")[i].classList.add("motor-name-layout-active");
    }

    function refuseItem_Active(i) {
        for (
            var key = 0; key < document.getElementsByClassName("motor-name-layout").length; key++
        ) {
            document
                .getElementsByClassName("motor-name-layout")[key].classList.add("motor-name-layout-refuse");
        }
        console.log("name" + i);
    }

    function addItem_Active(i) {
        for (
            var key = 0; key < document.getElementsByClassName("motor-name-layout").length; key++
        ) {
            document
                .getElementsByClassName("motor-name-layout")[key].classList.remove("motor-name-layout-refuse");
        }
    }
    useEffect(() => {
        document
            .getElementsByClassName("mv-nav-type-pc")[0]
            .classList.add("mv-nav-item__active_default");
        document
            .getElementsByClassName("motor-name-layout")[0]
            .classList.add("motor-name-layout-active");
        document
            .getElementsByClassName("mv-nav-desktop")[0]
            .addEventListener("mouseout", addItem_Active_Default);
        for (
            var k = 0; k < document.getElementsByClassName("mv-nav-dk").length; k++
        ) {
            document
                .getElementsByClassName("mv-nav-dk")[k].addEventListener("mouseover", () => {
                    document
                        .getElementsByClassName("mv-nav-desktop")[0]
                        .classList.add("mv-nav-desk__white");
                    document.getElementById("nav-logo").style.display = "none";
                });
            document
                .getElementsByClassName("mv-nav-dk")[k].addEventListener("mouseout", () => {
                    document
                        .getElementsByClassName("mv-nav-desktop")[0]
                        .classList.remove("mv-nav-desk__white");
                    document.getElementById("nav-logo").style.display = "block";
                });
        }
        for (
            var i = 0; i < document.getElementsByClassName("mv-nav-type-pc").length; i++
        ) {
            document
                .getElementsByClassName("mv-nav-type-pc")[i].addEventListener(
                    "mouseover",
                    changeItem_Active.bind(Event, i),
                    false
                );
        }
        for (
            var i = 0; i < document.getElementsByClassName("motor-name-pc").length; i++
        ) {
            document
                .getElementsByClassName("motor-name-pc")[i].addEventListener(
                    "mouseover",
                    refuseItem_Active.bind(Event, i),
                    true
                );
            document
                .getElementsByClassName("motor-name-pc")[i].addEventListener("mouseout", addItem_Active.bind(Event, i), true);
        }
    });
    const colorNavTag = colorBlack ? "" : "colorReverse";
    return ( <
        >
        <
        nav className = "mv-nav-desktop" >
        <
        ul >
        <
        li className = { "mv-nav-dk mv-nav-left " + colorNavTag }
        id = "motorcycles-nav" >
        <
        a href > Motorcycles < /a> <
        ul className = "mv-nav-type-layout" > {
            navMotorsData.map((navMotorData) => ( <
                li className = "mv-nav-type-pc" >
                <
                a href > { navMotorData.type } <
                img alt = ""
                src = { `./img/img-tag/${navMotorData.img_pop}` }
                height = "100%" >
                <
                /img> < /
                a > <
                ul className = "motor-name-layout" > {
                    navMotorData.models.map((model) => ( <
                        NavModel model = { model }
                        />
                    ))
                } <
                /ul> < /
                li >
            ))
        } <
        /ul> < /
        li > <
        li className = { "mv-nav-dk mv-nav-left " + colorNavTag }
        id = "ownership-tag-nav" >
        <
        a href > OwnerShip < /a> <
        NavOwnership / >
        <
        /li> <
        li className = { "mv-nav-dk mv-nav-right " + colorNavTag } >
        <
        a href > EN < /a> < /
        li > <
        li className = { "mv-nav-dk mv-nav-right " + colorNavTag }
        id = "store-tag-nav" >
        <
        a href > Store < /a> <
        NavStore / >
        <
        /li> <
        li className = { "mv-nav-dk mv-nav-right " + colorNavTag }
        id = "dealer-tag-nav" >
        <
        a href > Dealer < /a> <
        NavDealer / >
        <
        /li> <
        li className = { "mv-nav-dk mv-nav-right " + colorNavTag }
        id = "company-tag-nav" >
        <
        a href > Company < /a> <
        NavCompany / >
        <
        /li> < /
        ul >

        <
        a href = "homepage"
        style = {
            { width: "140px" }
        } >
        <
        img alt = ""
        src = "./img/mv-agusta-logo.png"
        id = "nav-logo" > < /img> < /
        a > <
        /nav> < /
        >
    );
